import React, { Component } from 'react';
import './App.css';
import { Button, Container } from 'reactstrap';
import { Link } from 'react-router-dom';

class Home extends Component {
    render() {
        return (
            <div class="jumbotron">
                <Container fluid>
                <h1>Welcome to Management System!</h1>
                <p>Manage your employees and action items based on various parameters.</p>
                <p><a class="btn btn-primary btn-lg" tag={Link} to='/Users'>Users</a></p>
                <p><a class="btn btn-primary btn-lg" tag={Link} to='/Tasks'>Tasks</a></p>


                </Container>
            </div>
        );
    }
}

export default Home
